import React from "react";

function Header({name}) {

function onSignOut() {
  localStorage.removeItem('jwt')
}

  return (
    <header className="header">
      <div className="header__logo" />
      {name === 'sign-up' ? <link to="sign-in" className="..." >djqnb</link>
      : name === 'sign-in' ?
       <link to="sign-in" className="..." >registracia</link>
    : <link to='/' onClick={onSignOut}>wiiti</link>  }
    </header>
  );
}

export default Header;
